style.css:
@-moz-document domain("roblox.com") {
/*/ Set Background #1 /*/
	html, .content, .dark-theme, .light-theme, .nav-content, .MuiGrid-root.MuiGrid-container.MuiGrid-direction-xs-column.jss3 {
    width: 100% !important;
    height: 100% !important;
    background-size: cover !important;
  	background-attachment: fixed !important;
    background-image: url(data:image/jpeg;base64,);
  }
  
  /*/ Page Colors /*/
  #navigation, #chat-header, #header {
    background-color: black !important;
  }
  
  /*/ Hide Backgrounds #1 /*/
  body, body#rbx-body, .content {
 	  background: transparent !important;
  }
  
  /*/ Hide Backgrounds #2 /*/
  .profile-avatar-left, .item-thumbnail-container, .accoutrement-item a, .accoutrment-image, .asset-thumb-container {
    background-color: transparent !important;
  }
  
  /*/ Hide Backgrounds #3 /*/
  .btr-preview-container, .avatar-back {
    background: none !important;
  }
  
  /*/ Hide Footer /*/
  footer#footer-container {
    display: none !important;
  }
  
  /*/ Pulsing Animation /*/
  @keyframes header-pulse {
    0% {
      border-color: red;
      border-width: 3px;
    } 25% {
      border-color: black;
			border-width: 1px;
    } 75% {
      border-color: black;
			border-width: 1px;
    } 100% {
      border-color: red;
			border-width: 3px;
    }
  }
  
  /*/ Header Animation /*/
	#header {
    animation: header-pulse 5s infinite;
	}
}
